SDL_Boolean GetBoolean(TextFile F, SDL_Charstring Prompt)
{
#ifdef XMONITOR
  SDL_Boolean Result = 0;
#endif
  char buf[256];

#ifdef XMONITOR
  if (F == stdin) {
     xGetValue(F, Prompt, xSrtN_SDL_Boolean, (void *)&Result,
            "GetBoolean");
     return Result;
  }
#endif
  fscanf (F, "%s", buf);
  if (strcmp (buf, "true") == 0)
     return SDL_True;
  else if (strcmp (buf, "false") == 0)
     return SDL_False;
  else {
     fprintf (stderr, "Illegal value in input (GetBoolean): %s", buf);
     return SDL_False;
  }
}

